      ></ExpenseItem>
      <ExpenseItem
        id={props.item.expenses[3].id}
        title={props.item.expenses[3].title}
        amount={props.item.expenses[3].amount}
        date={props.item.expenses[3].date}
      ></ExpenseItem>
    </Card>
    
      );

}

export default Expenses;
